        public static void PopulateDP(int size)
        {
            for (int i = 0; i < size; i++)
            {
                DP[i] = int.MaxValue;
            }

            DP[0] = 0;

            foreach (int coin in coins)
            {
                if (coin > size)
                {
                    break;
                }

                for (int j = 0; j <= size; j++)
                {
                    if (j + coin <= size && DP[j] + 1 < DP[j + coin])
                    {
                        DP[j + coin] = DP[j] + 1;
                    }
                }
            }
        }

